import React, { useEffect, useRef, useState, useCallback } from 'react';
import API from '../api';


const Playback = () => {

    // STATE
    const [cameras, setCameras] = useState([]);
    const [camId, setCamId] = useState('');
    const [timelineSegments, setTimelineSegments] = useState([]);
    const [serverDayStart, setServerDayStart] = useState(0);
    const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);

    // REFS
    const videoRef = useRef(null);
    const canvasRef = useRef(null);

    // 1. LOAD CAMERAS
    useEffect(() => {
        API.get('/cameras').then(res => {
            setCameras(res.data);
            if (res.data.length > 0) setCamId(res.data[0].id);
        }).catch(err => console.error("Cameras load error", err));
    }, []);

    // 2. LOAD SEGMENTS (Când schimb camera sau data)
    useEffect(() => {
        if (!camId) return;

        // Fetch Timeline Data (Segments + DayStart logic from Backend)
        // Using existing endpoint '/timeline-day' which matched the blueprint's '/api/segments' logic
        API.get(`/playback/timeline-day/${camId}/${selectedDate}?_ts=${Date.now()}`)
            .then(res => {
                const { segments, dayStart } = res.data;
                setServerDayStart(dayStart);
                setTimelineSegments(segments || []);
            })
            .catch(err => console.error("Timeline error", err));

    }, [camId, selectedDate]);

    // 3. DRAW TIMELINE (Pe canvas)
    useEffect(() => {
        const canvas = canvasRef.current;
        if (!canvas || !serverDayStart) return;

        const ctx = canvas.getContext('2d');
        const width = canvas.width;
        const height = canvas.height;
        const DAY_MS = 86400000;

        // Clear
        ctx.fillStyle = '#1e1e1e';
        ctx.fillRect(0, 0, width, height);

        // Hours Grid
        ctx.strokeStyle = '#444';
        ctx.lineWidth = 1;
        ctx.beginPath();
        for (let h = 0; h <= 24; h++) {
            const x = (h / 24) * width;
            ctx.moveTo(x, 0);
            ctx.lineTo(x, height);
            ctx.fillStyle = '#888';
            ctx.fillText(`${h}:00`, x + 2, 10);
        }
        ctx.stroke();

        // Draw Segments (Green Bars)
        ctx.fillStyle = '#2ecc71'; // Culoarea ceruta
        const pxPerMs = width / DAY_MS;

        timelineSegments.forEach(s => {
            const sStart = Number(s.start_ts);
            const sEnd = s.end_ts === 0 ? Date.now() : Number(s.end_ts);

            // Clamp la ziua curenta
            const start = Math.max(sStart, serverDayStart);
            const end = Math.min(sEnd, serverDayStart + DAY_MS);

            if (end <= start) return;

            const x = (start - serverDayStart) * pxPerMs;
            const w = Math.max((end - start) * pxPerMs, 2); // Min 2px vizibil

            ctx.fillRect(x, 15, w, height - 15);
        });

    }, [timelineSegments, serverDayStart]);

    // 4. CLICK HANDLER (PLAYBACK)
    const handleCanvasClick = (e) => {
        if (!serverDayStart) return;

        const canvas = canvasRef.current;
        const rect = canvas.getBoundingClientRect();
        const x = e.clientX - rect.left;

        // Calcul Timestamp Absolut
        const width = rect.width;
        const ratio = x / width;
        const clickTs = Math.floor(serverDayStart + ratio * 86400000);

        console.log(`[Playback] Seek to: ${new Date(clickTs).toLocaleTimeString()} (${clickTs})`);

        loadPlayback(clickTs);
    };

    const loadPlayback = (ts) => {
        if (videoRef.current) {
            // URL Direct catre Backend (Blueprint Stabil)
            // folosim /stream/ pt controllerul nou
            const url = `${API.defaults.baseURL}/playback/stream/${camId}?ts=${ts}&_nocache=${Date.now()}`;
            console.log(`[Player] Loading: ${url}`);

            videoRef.current.src = url;
            videoRef.current.load();
            videoRef.current.play().catch(e => console.error("Play error:", e));
        }
    };

    return (
        <div className="playback-page" style={{ padding: 20 }}>
            {/* TOOLBAR */}
            <div style={{ marginBottom: 10, display: 'flex', gap: 10 }}>
                <select value={camId} onChange={e => setCamId(e.target.value)} style={{ padding: 5 }}>
                    {cameras.map(c => <option key={c.id} value={c.id}>{c.name || c.ip}</option>)}
                </select>
                <input
                    type="date"
                    value={selectedDate}
                    onChange={e => setSelectedDate(e.target.value)}
                    style={{ padding: 5 }}
                />
            </div>

            {/* PLAYER */}
            <div className="video-container" style={{ background: '#000', width: '100%', height: '60vh', marginBottom: 10 }}>
                <video
                    ref={videoRef}
                    id="player"
                    controls
                    autoPlay
                    style={{ width: '100%', height: '100%' }}
                />
            </div>

            {/* TIMELINE */}
            <div className="timeline-container" style={{ width: '100%', height: 60, position: 'relative' }}>
                <canvas
                    ref={canvasRef}
                    id="timeline"
                    width={1800} // Rezolutie interna mare pt claritate
                    height={60}
                    style={{ width: '100%', height: '100%', cursor: 'pointer', background: '#1e1e1e' }}
                    onClick={handleCanvasClick}
                />
            </div>

            <div style={{ marginTop: 5, color: '#666', fontSize: 12 }}>
                * Click on the green bars to play.
            </div>
        </div>
    );
};

export default Playback;
